/**
 * artist
 * album
 * genre
 * release_date
 * label
 * price
 * tracklist
 * cover_image
 */
const InventoryList = ({products}) => {

  return (
    <div>
      {products.map(p => (
        <span key={p.id}> 
          <h1></h1>
          {p.album_title + '\n'}
        </span>
      ))}
      
    </div>
  );
}; export default InventoryList;
